import React, { useState, useEffect } from "react";

const City = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        setData(data.data);
      });
  }, []);
  return (
    <>
        <h1 className="text-center my-3 font-weight-bold">API TABLE</h1>
      <div className='text-center'>
        <button className="btn btn-dark"><a href="/cities" className="text-decoration-none text-light">City Table</a></button>
      </div>
    </>
  )
  
};

export default City;
